import React from "react";
const SimpleOnlinePlayerList = (props) => {
  return (
    <div>
      <ul>
        {props.data.map((user) => (
          <li key={user.id}>
            <h3>{user.name}</h3>
          </li>
        ))}
      </ul>
      <p>{props.isFetching ? "Fetching users..." : ""}</p>
    </div>
  );
};
export default SimpleOnlinePlayerList;
